class Solution:
    def maxOperations(self, s: str) -> int:
        seen = 0
        ans = 0
        found_zero = False
        for i, c in enumerate(s):
            if c == "1":
                seen += 1
                found_zero = False
            else:
                if seen > 0 and found_zero == False:
                    ans += seen
                    found_zero = True

        return ans
